textOriginal:
Haja falsidade! Bolsonaro não criou auxílio nenhum, até porque ele sempre foi contra esse benefício social, e chamou isso de "política nefasta" e que "sustenta vagabundo". Quando ele era deputado, propôs castrar as mulheres (não poderia ser os homens, não é? já que ele é machista) após elas terem o 1º filho, pois Bolsonaro alegou que elas engravidam para ficar ganhando auxílio do governo. Essa é a verdadeira opinião dele sobre esses auxílios. O que há é o Bolsa Família criado pelo Lula, e que o Bolsonaro apenas mudou de nome. O benefício só teve o valor aumentado graças às pressões dos deputados e senadores.

A transposição do Rio São Francisco foi feita em mais de 80% pelo governo PT, Bolsonaro concluiu uma parte ínfima que qualquer presidente no lugar dele teria concluído.

Bolsonaro é tão ladrão, que além de se apropriar dos símbolos da república, dos recursos do estado para fins pessoais (como transportar convidados do casamento do Eduardo Bananinha com avião da FAB), ele quer roubar também os programas sociais e investimentos de infraestruturas criado pelos outros governos.

Bolsonaro representa:

- Sigilo de 100 anos;
- Orçamento Secreto (corrupção institucionalizada);
- Corrupção em barras de ouro no MEC;
- Corrupção no esquema da Cloroquina;
- Superfaturamento nas vacinas;
- Gastos com próteses penianas e viagra;
- Rachadinhas;
- Imóveis comprados com dinheiro vivo;
- "Passagem da boiada";
- Deboche aos doentes pela Covid;
- Vagabundices de jetski e motociata com frequência;
- Compra de votos e coação de eleitores;
- Xenofobia e racismo;
- Disposição ao CANIBALISMO;
- Histórico de ZOOFILIA (declaração dele ao CQC, mediante confirmação de polígrafo);
- Verborragias pornográficas;
- Jesus armamentista (blasfêmia para os verdadeiros cristãos);
- Obscurantismo travestido de "fé";
- Terraplanismo;
- Apologia ao Nazismo;
- Aparelhamento do estado;
- Cocaína no avião de comitiva presidencial (só foi barrado na Espanha, tamanha a incompetência ou conivência dos militares brasileiros);
- Ministros charlatões (com falsificação de currículo);
- FOME - FILA DO OSSO, queda no poder aquisitivo da população (inclusive de classe média);
- Precarização aos trabalhadores;
- Humilhação aos pobres;
- Aumento da violência urbana;
- Milícias à vontade;
- Baixaria, fanatismo, e alienação;
- Hipocrisias;
- Isolamento nas relações internacionais (brigas sem sentido, contra outras nações);
